        </Dropdown>


          <button className="btn btn-danger" type="submit" style={{marginRight: '10px'}}>Create Alert</button>
          <a href="https://royaremlak.com/"><img src={royar} alt="royar" style={{width: '45px', height: '40px', position: 'absolute',left: '95%'}}/></a>
    </form>
